      SELECT DISTINCT - col1 * - cor0.col0 + - col1 * ( ( cor0.col2 ) ) - - col0 * + ( + col0 + 16 ) AS col1 FROM tab1 (FORMAT parquet) AS cor0;
  - name: tab1

outputs:
  - name: q11230.out
    data: |
      -1269
      5190
      7472
